                {/*    <div className={viewStyle.view1}>*/}
                {/*        活跃数量*/}
                {/*    </div>*/}
                {/*</div>*/}
                {/*<div className={viewStyle.right}>*/}
                {/*    <div className={viewStyle.view1}>*/}
                {/*        活跃数量*/}
                {/*    </div>*/}
                {/*    <div className={viewStyle.view1}>*/}
                {/*        活跃数量*/}
                {/*    </div>*/}
                {/*    <div className={viewStyle.view1}>*/}
                {/*        活跃数量*/}
                {/*    </div>*/}
                {/*</div>*/}
                <div style={{clear:"both"}}></div>
            </div>
        );
    }
}

export default View;
